import { useEffect,useState } from "react";
import {Row,Col} from 'react-bootstrap';
import Grade from "../components/Grade.jsx";
import axios from 'axios';
import grades from "../grade.js";

const HomeScreen=()=>{
    return(
        <>
        <h1>Grades</h1>
        <Row>
            {grades.map((grade)=>(
                <Col key={grade._id} sm={12} md={6} lg={4} cl={3}>
                    <Grade grade={grade}/>
                </Col>
            ))}
        </Row>
        </>
    )
}

